
import ObjectRetriever from "./ObjectRetriever"

export default class ConstantObjectRetriever implements ObjectRetriever {
    private value:Object;

    constructor(o:Object) {
        this.value = o;
    }

    getId(o:Object) {
        return "constant";
    }

    getObject(s:string):Object {
        return this.value;
    }
    preToDocument(o:Object){}
    postToObject(o:Object){}
}
